function Article({ date, image, title, url }) {
  return (
    <div className="card">
      <img className="card-img-top" src={image.file.url} alt={image.title} />
      <div class="card-body">
        <h5 class="card-title">{title}</h5>
        <p class="card-text">{date}</p>
        <a href="#" class="btn btn-primary">Go somewhere</a>
      </div>
    </div>
  )
}

export default Article
